import React, {useState} from "react";
// import { BrowserRouter as Router, Route, Switch } from "react-router-dom";
// import Users from "./users/pages/users";
// import newPlace from "./places/pages/newPlace";
// import { Redirect } from "react-router-dom/cjs/react-router-dom.min";

// import MainNavigation from './shared/components/Navigation/MainNavigation';

// import DataFetch from './database/DataFetch';
// import Rout from './router/Route'

function App() {
    let [gotData, updateData] = useState(false);
    let [gotImg, updateImg] = useState("data:image/jpeg;base64,");


    const proceed = () => {
        updateData(true);
    }

    const proo = () => {
        updateImg("data:image/jpeg;base64,");

    }

    return (
        <div>
            <button type="submit" onClick={proceed}>Load All Database</button>

            {gotData && <React.fragment><button type="submit" onClick={proo}>Select City</button> <img src={gotImg} />
            </React.fragment>}
        </div>
    )
}

export default App;
